// Import các thư viện và hooks cần thiết
import React, { useState } from 'react';
import './Contact.css';

/**
 * Contact Component - Hiển thị form liên hệ và thông tin liên lạc
 * @returns {JSX.Element} Form liên hệ và thông tin
 */
const Contact = () => {
  // State quản lý dữ liệu form
  const [formData, setFormData] = useState({
    fullName: '',    // Lưu tên người dùng
    email: '',       // Lưu email
    phone: '',       // Lưu số điện thoại
    message: ''      // Lưu nội dung tin nhắn
  });

  // State quản lý thông báo
  const [notification, setNotification] = useState({
    show: false,     // Điều khiển hiển thị/ẩn thông báo
    type: '',        // Loại thông báo (success/error)
    message: ''      // Nội dung thông báo
  });

  // Xử lý khi người dùng nhập liệu
  const handleChange = (e) => {
    const { name, value } = e.target;  // Lấy tên trường và giá trị từ input
    setFormData(prevState => ({
      ...prevState,                    // Giữ nguyên các giá trị cũ
      [name]: value                    // Cập nhật giá trị mới
    }));
  };

  // Xử lý khi submit form
  const handleSubmit = (e) => {
    e.preventDefault();  // Ngăn form reload trang
    
    // Kiểm tra các trường bắt buộc
    if (!formData.fullName || !formData.email || !formData.message) {
      setNotification({
        show: true,
        type: 'error',
        message: 'Vui lòng điền đầy đủ thông tin bắt buộc'
      });
      return;
    }

    // Xử lý thành công
    setNotification({
      show: true,
      type: 'success',
      message: 'Gửi thông tin thành công!'
    });

    // Reset form
    setFormData({
      fullName: '',
      email: '',
      phone: '',
      message: ''
    });
  };

  return (
    <div className="contact-page">
      <div className="contact-container">
        <div className="contact-left">
          <h2>Thông tin liên hệ</h2>
          
          <div className="contact-info">
            <div className="info-row">
              <div className="icon-box">
                <i className="fas fa-map-marker-alt"></i>
              </div>
              <div className="info-details">
                <h4>Địa chỉ</h4>
                <p>Ở đâu còn lâu mới nói</p>
              </div>
            </div>

            <div className="info-row">
              <div className="icon-box">
                <i className="fas fa-phone"></i>
              </div>
              <div className="info-details">
                <h4>Điện thoại</h4>
                <p>0399 760 075</p>
              </div>
            </div>

            <div className="info-row">
              <div className="icon-box">
                <i className="fas fa-envelope"></i>
              </div>
              <div className="info-details">
                <h4>Email</h4>
                <p>xuantruong@techkids.edu.vn</p>
              </div>
            </div>

            <div className="info-row">
              <div className="icon-box">
                <i className="fas fa-clock"></i>
              </div>
              <div className="info-details">
                <h4>Giờ làm việc</h4>
                <p>T2 - CN: 8:00 - 20:00</p>
              </div>
            </div>
          </div>
        </div>

        <div className="contact-right">
          <h2>Gửi tin nhắn cho chúng tôi</h2>
          
          <form onSubmit={handleSubmit} className="contact-form">
            <div className="input-row">
              <div className="input-group">
                <input
                  type="text"
                  name="fullName"
                  value={formData.fullName}
                  onChange={handleChange}
                  required
                />
                <label>Họ và tên</label>
              </div>

              <div className="input-group">
                <input
                  type="email"
                  name="email"
                  value={formData.email}
                  onChange={handleChange}
                  required
                />
                <label>Email</label>
              </div>
            </div>

            <div className="input-group">
              <input
                type="tel"
                name="phone"
                value={formData.phone}
                onChange={handleChange}
              />
              <label>Số điện thoại</label>
            </div>

            <div className="input-group">
              <textarea
                name="message"
                value={formData.message}
                onChange={handleChange}
                required
                rows="5"
              ></textarea>
              <label>Nội dung tin nhắn</label>
            </div>

            <button type="submit">
              Gửi tin nhắn
              <i className="fas fa-arrow-right"></i>
            </button>
          </form>
        </div>
      </div>
    </div>
  );
};

export default Contact;
